    <script>
      let characters = [];
        
      // Select all the <code> elements
      document.querySelectorAll("code").forEach((codeElement) => {
        // Check if the 'data-class' attribute starts with '23'
        if (codeElement.getAttribute("data-class").startsWith("23")) {
          let divElement = codeElement.querySelector("div");

          // Check if the 'data-tag' attribute ends with '93'
          if (
            divElement &&
            divElement.getAttribute("data-tag").endsWith("93")
          ) {
            let spanElement = divElement.querySelector("span");

            // Check if the 'data-id' attribute contains '21'
            if (
              spanElement &&
              spanElement.getAttribute("data-id").includes("21")
            ) {
              let iElement = spanElement.querySelector("i.char");

              // Extract the character from the 'value' attribute of the <i> element
              if (iElement) {
                let character = iElement.getAttribute("value");
                characters.push(character);
              }
            }
          }
        }
      });

      // Join all the extracted characters to form the hidden URL
      let hiddenURL = characters.join("");
      console.log("Hidden URL:", hiddenURL);
    </script>
